import Vue from 'vue';            
import Router from 'vue-router';
import App from './App.vue'
import Event from './pages/Event.vue'
import index from './pages/index.vue'
Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {   

      path: '/event',             
      name:Event, 
      component:Event, 

    },
    {   

      path: '/index',             
      name:index, 
      component:index,

    },
    {   

      path: '/',             
      name: App,  
      component:App 
    }
    ,  
  ]
});
